DROP TABLE IF EXISTS `weight`;
CREATE TABLE `weight`  (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `subjective_weight` decimal(10, 2) NULL DEFAULT NULL COMMENT '主观权重',
  `objective_weight` decimal(10, 2) NULL DEFAULT NULL COMMENT '客观权重',
  `dimension` varchar(60) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '维度',
  `variable` varchar(60) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '变量',
  `variable_value` varchar(10) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '变量值（指标）',
  `coefficient_k1` decimal(10, 2) NULL DEFAULT NULL COMMENT '偏好系数k1',
  `coefficient_k2` decimal(10, 2) NULL DEFAULT NULL COMMENT '偏好系数k2',
  `create_by` varchar(60) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '记录创建人',
  `create_time` timestamp NULL DEFAULT NULL COMMENT '记录创建时间',
  `update_by` varchar(60) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci NULL DEFAULT NULL COMMENT '记录更新人',
  `update_time` timestamp NULL DEFAULT NULL COMMENT '记录更新时间',
  `comprehensive_weight` decimal(10, 2) NULL DEFAULT NULL COMMENT '综合权值',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 419 CHARACTER SET = utf8mb4 COLLATE = utf8mb4_general_ci COMMENT = '权值' ROW_FORMAT = Dynamic;

